import React from 'react';
import './App.css';
import SmallText from './components/SmallText.js';
import TitleText from './components/TitleText.js';
import TextButton from './components/TextButton.js';
import DspButton from './components/DspButton.js';
import SwitchButton from './components/SwitchButton.js';
import NumberInput from './components/NumberInput.js';
import TabGroup from './components/ButtonGroup.js';

const { Grid } = semanticUIReact;

class SpacingPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            streamNumber: null,
            role: null,
            recordDeal: [],
            publishDeal: [],
            sliderValue: null,
            recordDealSelected: null,
            publishingDealSelected: null,
            advance: null
        };

    }

    render() {
      return (
        <div style={{display: 'flex', flexDirection: 'row'}}>
            <div style={{width: 'auto', flexDirection: 'colum', backgroundColor:'pink'}}>
              <TitleText text="About You" style={{ fontSize: '24px', fontWeight: 'bold', lineHeight: '1.09', textAlign: 'center', color: '#323747' }}/>
              <div style={{backgroundColor: 'red'}}>
                <SmallText text="Your Role" style={{ fontSize: '20px', fontWeight: '500', lineHeight: '1.09', textAlign: 'center', color: '#323747' }}/>
                <TabGroup/>
              </div>
              <div style={{width: '33%', backgroundColor: 'aqua'}}>
                <SmallText text="Include" style={{ fontSize: '24px', fontWeight: 'bold', lineHeight: '1.09', textAlign: 'center', color: '#323747' }}/>
                <div style={{display: 'flex', flexWrap: 'wrap'}}>
                  <DspButton text="Spotify"/> <DspButton text="Apple Music"/><DspButton text="Tidal"/>
                  <DspButton text="Youtube (Contend ID)"/> <DspButton text="Amazon Unlimited"/><DspButton text="Google Play"/>
                  <DspButton text="Pandora"/> <DspButton text="Amazon Music"/><DspButton text="Rhapsody"/>
                </div>
              </div>
            </div>
            <div style={{width: 'auto', flexDirection: 'colum', backgroundColor:'grey'}}>
              <SmallText text="top middle" style={{backgroundColor: 'Red'}}/>
              <SmallText text="middle middle" style={{backgroundColor: 'aqua'}}/>
              <SmallText text="bottom middle" style={{backgroundColor: 'green'}}/>
            </div>
            <div style={{width: 'auto', flexDirection: 'colum', backgroundColor:'brown'}}>
              <SmallText text="top right" style={{backgroundColor: 'Orange'}}/>
              <SmallText text="middle right" style={{backgroundColor: 'salmon'}}/>
            </div>
        </div>
        )
    }
  }

  export default SpacingPage;
